import React from 'react'
import MultiplePizzas from '../assets/multiplePizzas.jpeg';

function About() {
  return (
    <div className="about">
        <div className="aboutTop" style={{backgroundImage: `url(${MultiplePizzas})`}}>
            <h1>haha</h1>
        </div>
        <div className="aboutBottom">
            <h1>About Us</h1>
        </div>
    </div>
  )
}

export default About
